(:action open
  :parameters (?obj - object ?agent - agent)
  :precondition (and (in_reach_of_agent ?obj) (not (open ?obj)))
  :effect (and (open ?obj) 
              (forall 
                  (?other_obj - object) 
                  (when 
                      (and 
                          (inside ?other_obj ?obj) 
                          (not (open ?obj))
                      )
                      (not (inside ?other_obj ?obj))
                  )
              )
          )
)
(:action grasp
  :parameters (?obj - object ?agent - agent)
